import React from 'react';
import Paper from '@mui/material/Paper';
import { Box, Radio } from '@mui/material';

const ProductCard = ({title, productName}) => {
  return (
            <Paper elevation={3} sx={{
                  display: 'flex',
                  flexWrap: 'wrap',
                  width: 280,
                  height: 280
            }}>
                  {title}
                  <Radio
                        checked={false}
                        value={productName}
                        name="chooseProduct"

                  />
            </Paper>
  )
}

export default ProductCard;
